import React from "react";

const NavBar = props => {
  return (
    <nav className="navbar navbar-light bg-light">
      <a href="#" className="navbar-brand">
        Logout
      </a>
      <a href="#" className="navbar-brand">
        Login
      </a>
    </nav>
  );
};
export default NavBar;
